import React, { useState } from "react";
import KeyD1 from "/Users/marekpolgesek/Desktop/{coding, dev}/Frontend Projects/Portfolio/portfolio-website/src/Images/Key-D1.png";

const NanseaWebsite = () => {
  const [modal, setModal] = useState(false);

  const toggleModal = () => {
    setModal(!modal), console.log("toggled");
  };

  return (
    <>
      <main>
        <h1>nansea website project descr.</h1>
        <img src={KeyD1} onClick={toggleModal}></img>
      </main>

      <div className="modal"></div>
    </>
  );
};

export default NanseaWebsite;
